description:
Adobe Photoshop Elements is a powerful yet simple graphic editing tool with two main apps: the element Organizer and the image Editor. Both tools are perfectly embedded within each other and easily accessible via the menu on the top of the program's sleek, elegant dark interface.

The Organizer in Adobe Photoshop Elements lets you not only browse photos, but also rate them, add a caption, use them as wallpaper and also add name tags to them in order to identify the people that appear on the images.

The Editor in Adobe Photoshop Elements includes all the tools you need to edit, fix, share and design all sorts of printed creations with your images. The program features three different editing modes (Full, Quick and Guided), suitable for all levels of expertise. You'll be able to resize, crop, remove the red-eye effect, adjust color and lighting, tweak levels and contrasts, or simply apply some automatic quick fixes to your photos. Adobe Photoshop Elements also helps you apply more elaborate effects in an easy, step-by-step process.

Adobe Photoshop Elements is also a perfect tool to create photo collages, postcards, calendars and other similar goodies with your images. The Sharing tool, in turn, allows you to create online albums, burn your images onto CD or DVD, send them by email, and share them on Facebook or Flickr straight away.

