Most recently Adobe Photoshop Elements has been updated with some useful tweaking functions such as Pet Red Eye removal, the ability to move objects around in an image, and improved integration with mobile devices such as tablets.

Adobe Photoshop Elements is a powerful application with which you can organize, edit, enhance and share your images in many ways, without requiring professional photo editing skills.

